import React, { useState } from "react";
import {Link} from 'react-router-dom';
import axios from 'axios';
export default function Register() {
    const [user,setuser]=useState("");
    const [pass,setpass]=useState("");
    const SaveVal=()=>
    {
        axios.post("https://localhost:9090/reg",user,pass).then(response=>{console.log(response)});
    }
    return (
        <div>
        <h1>Hello User this is Register</h1>
        <form onSubmit={SaveVal}>
            <input type="text" placeholder="Enter Username" value={user} required onChange={(e)=>{setuser(e.target.value)}}></input>
            <input type="password" placeholder="Enter Password" value={pass} required onChange={(e)=>{setpass(e.target.value)}}></input>
            <button type="submit">Register</button>
        </form>
        <Link to="/login">Login</Link>
        </div>
    );
}
